import React from "react";
import Header from "./Header"
import Footer from "./Footer"
import Note  from "./Note"

function App() {
    return (<div>
        <Header/>

        <div className="Title">
            <form>
                <input type="textarea" name=" Title" placeholder="Title"></input>
                <p><input type="text" name=" Note" placeholder="Take a note..."></input></p>
                <button type="submit">Add</button>
            </form>
        </div>

   
        <Footer/>
        </div>
    );
}
export default App;
